import React, {Component} from 'react';
import Cart from './Cart.js'
import { withRouter } from 'react-router-dom';
import { Button, Card, CardBody, CardGroup, Col, Container, Input, InputGroup, InputGroupAddon, InputGroupText, Row, NavLink  } from 'reactstrap';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
    this.routeChange = this.routeChange.bind(this);
  }

  routeChange() {
    let path = "./Cart.js";
    this.props.history.push(path);
  }

  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <div>
          <h1>Welcome to Shop-R-Us!</h1>  
          this.props.cartList.map(e =>  {
        <div className="container">
        <div className="col-xs-12">
        <h1>Your current Cart:</h1>
          <div className = "data">
            <scope className = "row">
            <p className="elements">
             {e.title} {e.description} {e.completed} {e.userId}
            </p>
            </scope>
           </div> 
        )}
        </div>
        </div>
    });

      </div>
    );
  }

}

export default App;
